import logo from './logo.svg';
import './App.css';

function App() {
  return (
    <body>
      <div className="App">
        <img src={logo} className="App-logo" alt="logo" />
        <h1>REACT CRUD APP</h1>
        <div className= "form_a">
          <table>
            <input type="text" name="movieName" />
            <input type="text" name="review" />
          </table>
        </div>
      </div>
    </body>
  );
}

export default App;
